import "./App.css";
import Dictionary from "./Dictionary";

function App() {
  return (
    <div className="App">
      <h1>Dictionary</h1>
      <div className="container">
        <Dictionary />
      </div>
      <footer className="footer">Coded by SheCodes</footer>
    </div>
  );
}

export default App;
